import React from 'react'

function Category(props) {
  return (

        <div>
            <p className="text text_type_main-medium mt-10 mb-6">{props.title}</p>
            <div className={burgerIngredients.ingredients_container}>
                {props.array.map((objBuns) => {return <IngredientCard key={objBuns._id} name={objBuns.name} image={objBuns.image} price={objBuns.price}/>})}
            </div>
        </div>

  )
}

export default Category
